export const PRESET_COLORS: readonly ["red", "green", "yellow", "grey", "blue"];
export function isPresetColor(s: unknown): s is "green" | "grey" | "red" | "yellow" | "blue";
export type PresetColor = (typeof PRESET_COLORS)[number];
export type ReferenceColor = PresetColor | (string & {});
export type Symbol = 'circle' | 'rect' | 'roundRect' | 'triangle' | 'diamond' | 'pin' | 'arrow' | 'none' | `path://${string}`;
